// SPDX-License-Identifier: MIT
pragma solidity ^0.6.7;

import "@chainlink/contracts/src/v0.6/interfaces/AggregatorV3Interface.sol";

contract PriceRace {
    enum Choice {
      None,
      UP,
      DOWN,
      EQUAL
    }

    enum Stage {
      In_progress,
      Liquidating,
      Finish
    }


    struct RoundDesc {
      uint80   chainlinkRoundID;
      uint256  raceID;
      uint256  deadline;
      Stage  stage;
      int  lockPrice;
      int resultPrice;
      Choice roundResult;
      uint256 uptotal;
      uint256 downtotal;
    }
    mapping(address => uint256) private ups;
    mapping(address => uint256) private downs;
    address payable [] private upplayers;
    address payable [] private downplayers;
    uint256  currentRaceID;
    RoundDesc currentRound;
    AggregatorV3Interface internal priceFeed;


    /**
     * Network: Harmony testnet
     * Aggregator: ONE/USD
     * Address: 0xcEe686F89bc0dABAd95AEAAC980aE1d97A075FAD
     */
    constructor() public {

        priceFeed = AggregatorV3Interface(0xcEe686F89bc0dABAd95AEAAC980aE1d97A075FAD);
        currentRaceID = 0;
        startRound();
    }

    function startRound() private {
      currentRaceID = currentRaceID + 1;
      currentRound.raceID = currentRaceID;
      currentRound.deadline = now + 1 minutes;
      currentRound.stage = Stage.In_progress;
      currentRound.roundResult =Choice.None;
      (currentRound.chainlinkRoundID, currentRound.lockPrice) = getLatestRound();
      currentRound.uptotal = 0;
      currentRound.downtotal = 0;

    }

    function getCurrentRaceDesc() public view returns(uint256,uint256, int ) {
      return (currentRound.raceID, currentRound.deadline,currentRound.lockPrice);
    }
    function getLatestRound() public view returns(uint80, int) {
      (
            uint80 roundID,
            int price,
            uint startedAt,
            uint timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
        return (roundID, price);
    }
    /**
     *
     */
    function getThePriceByRound(uint80 round) public view returns (uint80, int) {
        (
            uint80 roundID,
            int price,
            uint startedAt,
            uint timeStamp,
            uint80 answeredInRound
        ) = priceFeed.getRoundData(round);
        return (roundID, price);
    }
    event  Bet(address indexed player, uint256 raceID, uint256  amount, Choice choice);
    function betUp() payable public {

       uint amount = msg.value;
       ups[msg.sender] = amount;
       upplayers.push(msg.sender);
       currentRound.uptotal = currentRound.uptotal + amount;
       emit  Bet(msg.sender, currentRaceID, amount, Choice.UP);
    }

    function betDown() payable public {

       uint amount = msg.value;
       downs[msg.sender] = amount;
       downplayers.push(msg.sender);
       currentRound.downtotal = currentRound.downtotal + amount;
       emit  Bet(msg.sender, currentRaceID, amount, Choice.DOWN);
    }

    function Liquidate() public {
      (
            uint80 roundID,
            int price,
            uint startedAt,
            uint timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
      require(now >= currentRound.deadline);
      require(currentRound.stage == Stage.In_progress);
      currentRound.stage = Stage.Liquidating;
      int  resultPrice  = price;
      currentRound.resultPrice = resultPrice;
      if (price == resultPrice) {
          // EQUAL
        currentRound.roundResult = Choice.EQUAL;
        for (uint256 i = 0; i < upplayers.length;i++){
           address payable player = upplayers[i];
           uint256 amount = ups[player];
           player.transfer(amount);
           delete ups[player];
        }

        for (uint256 i = 0; i < downplayers.length;i++){
           address payable player = downplayers[i];
           uint256 amount = downs[player];
           player.transfer(amount);
           delete downs[player];
        }

      } else if(resultPrice > price ){
        // UP
        currentRound.roundResult = Choice.UP;
        for (uint256 i = 0; i < upplayers.length;i++){
           address payable player = upplayers[i];
           uint256 amount = ups[player];
           amount = amount + amount*currentRound.downtotal /currentRound.uptotal;
           player.transfer(amount);
           delete ups[player];
        }

        for (uint256 i = 0; i < downplayers.length;i++){
           address player = downplayers[i];
           delete downs[player];
        }

      } else {
        // DOWN
        currentRound.roundResult = Choice.DOWN;
        for (uint256 i = 0; i < upplayers.length; i++){
           address player = upplayers[i];
           delete ups[player];
        }

        for (uint256 i = 0; i < downplayers.length;i++){
           address payable player = downplayers[i];
           uint256 amount = downs[player];
           amount = amount + amount*currentRound.uptotal/currentRound.downtotal;
           player.transfer(amount);
           delete downs[player];
        }
      }
      delete upplayers;
      delete downplayers;

      currentRound.stage = Stage.Finish;

      startRound();
    }

}
